import React, { Component } from 'react';

import {Link} from 'react-router-dom';

class Debits extends Component {
  render() {
    let StaticElements = (
      <div>
        <Link to="/">Home</Link>
        <br/>
        <Link to="/userProfile">User Profile</Link>
        <h1>Debit Information</h1>
        <div>Current Balance: {this.props.accountBalance}</div>
      </div>
    );

    let displayInfo;
    console.log(this.props.debitInfo);
    console.log(this.props.debitInfo === NaN);
    if(!isNaN(this.props.debitInfo)){
      displayInfo =
      this.props.debitInfo.map( element => {
        return(
          <div className="DataInformation">
            <strong>{element["description"]}</strong>
            <br/>
            Amount: {element["amount"]}
            <br/>
            Date: {element["date"]}
            <hr/>
          </div>
        )});
    } else{
      displayInfo = <div>Current Loading!</div>
    }

    return (
        <div>
          {StaticElements}
          {displayInfo}
        </div>
    );
  }
}

export default Debits;
